using SixLabors.ImageSharp.Formats.Png;
using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;
using static System.Net.Mime.MediaTypeNames;
using Image = SixLabors.ImageSharp.Image;
using Font = Microsoft.Maui.Graphics.Font;
using PdfSharpCore.Drawing;
using PdfSharpCore.Drawing.Layout;
using PdfSharpCore.Pdf;
using PdfSharpCore.Pdf.IO;
using Microsoft.Maui.Graphics.Skia;
using Microsoft.Maui.Graphics;
using SixLabors.ImageSharp;
using System.Runtime.Intrinsics.Arm;

namespace TestImageAPI.Helper
{
    public static class Producer
    {


        /// <summary>
        /// Genera un immagine
        /// </summary>
        /// <param name="documents"></param>
        /// <returns></returns>
        public static async Task<string> ProduceImageTest()
        {

            System.Text.Encoding.RegisterProvider(System.Text.CodePagesEncodingProvider.Instance);
            string resp;

            try
            {
                using (SkiaBitmapExportContext page = new SkiaBitmapExportContext(

                    300, 400, 1.0f, 72
                   , disposeBitmap: true))
                {
                    ICanvas g = page.Canvas;

                    g.FillRectangle(0, 0,
                       300, 400);
                    g.FillColor = Colors.White;

                    //g.Antialias = false;
                    g.BlendMode = BlendMode.DestinationOver; //https://learn.microsoft.com/en-us/dotnet/maui/user-interface/graphics/blendmodes?view=net-maui-8.0




                    byte[] bytes = Convert.FromBase64String("");

                    using (MemoryStream ms = new MemoryStream(bytes))
                    {

                        ms.Position = 0;
                        using (IImage image = SkiaImage.FromStream(ms))
                        {
                            float newWidth, newHeight;
                            // Effettuo un resize dell'immagine per farla entrare perfettamente nell'area di stampa senza stretcharla
                            newWidth = (float)image.Width;
                            newHeight = (float)image.Height;

                            g.DrawImage(image,
                               1,
                                1,
                                300,
                                300);


                        }
                        g.FontColor = Colors.Black;
                        g.DrawString("Test text", 5, 300, 150, 7,
               HorizontalAlignment.Left, VerticalAlignment.Top, TextFlow.OverflowBounds, lineSpacingAdjustment: -100);
                        g.DrawString("Test text 2", 5, 320, 150, 7,
               HorizontalAlignment.Left, VerticalAlignment.Top, TextFlow.OverflowBounds, lineSpacingAdjustment: -100);
                        g.DrawString("Test text 3", 5, 330, 150, 7,
              HorizontalAlignment.Left, VerticalAlignment.Top, TextFlow.OverflowBounds, lineSpacingAdjustment: -100);



                    }

                    using (var ms = new MemoryStream())
                    {
                        page.WriteToStream(ms);

                        ms.Position = 0;
                        using (Image imgSharpImage = Image.Load(ms.ToArray()))
                        {
                            using (var imgStream = new MemoryStream())
                            {
                                //conversione in BN a soli 2 colori molto compresso (per rimuovere ogni possibile imperfezione)
                                PngEncoder pngEncoder = new PngEncoder
                                {
                                    BitDepth = PngBitDepth.Bit1,
                                    ColorType = PngColorType.Grayscale,
                                    CompressionLevel = PngCompressionLevel.BestCompression
                                };
                                imgSharpImage.SaveAsPng(imgStream, pngEncoder);
                                pngEncoder = null;


                                resp = Convert.ToBase64String(imgStream.ToArray());
                            }
                        }
                        return resp;
                    }
                   
                }



            }
            catch (Exception ex) {
                Console.WriteLine($"Error: {ex.ToString()}");
                return null;
            }
        }
    }
}

